import React from 'react';
import './Header.css'
import styled from 'styled-components'

const Header = () => {
    return (
        // <Router>
            <header className='header'>   
                    <Navbar>
                        <h2>Navbar <span>Responsive</span></h2>
                        <div>
                            <a href='/'>Home</a>
                            <a href='/'>About</a>
                            <a href='/'>Contact</a>
                        </div>
                        <div>
                            <a href="/">
                                
                            </a>
                        </div>
                    </Navbar>
            </header>
        // </Router>
    );
}

export default Header;

const Navbar = styled.nav`
    h2{
        font-weight: 400;
        span{
            font-weight: bold;
        }
    }
    height: 100%;
    display: flex;
    align-items: center;
    justify-content: space-between;
   
`
